// Welcome.js
import React from 'react';

const Welcome = () => {
  return (
    <div className="d-flex justify-content-center align-items-center vh-100 bg-light text-center">
      <div>
        <h1 className="display-3 text-primary">Welcome to Our Website!</h1>
        <p className="lead text-secondary">We're excited to have you here. Explore and enjoy our products!</p>
        <a href="#explore" className="btn btn-primary btn-lg">Get Started</a>
      </div>
    </div>
  );
};

export default Welcome;
